import React from 'react';

export default Login = props => {
    return (
        <form onSubmit={''}>
            <input 
                type="text"
                value={props.username}
                name='username'
                onChange={props.inputChangeHandler}
                placeholder='username'/>
            <input type="password"/>
            <input type="email"/>
            <button onCLick={''}>Sign in</button>
        </form>
    );
}
